    false,nt"url": null,nt"notes": "This document describes four alternatives
    for managing Nowitna National Wildlife Refuge and identifies the possible consequences
    of implementing the alternatives. Each alternative provides broad policy guidance
    for managing the refuge. Each alternative also identifies lands proposed for wilderness
    designation. The proposed boundary for the Nowitna Wild River corridor and the management
    practices to be permitted in the wild river corridor are also included in this document.
    An overview of the Refuge is provided along with information about the planning
    process. Public involvement; potential problems affecting fish, wildlife, and habitats;
    and a description of the affected environment are provided.",nt"license_title":
